def basic_calculator(s: str) -> int:
    stack = []
    num = 0
    sign = 1
    operator = '+'

    for ch in s:
        if ch.isdigit():
            num = num * 10 + int(ch)
        elif ch in ['+', '-', '*', '/']:
            if operator == '+':
                stack.append(num)
            elif operator == '-':
                stack.append(-num)
            elif operator == '*':
                stack[-1] = stack[-1] * num
            elif operator == '/':
                stack[-1] = int(stack[-1] / num)

            num = 0
            operator = ch
        elif ch == ' ':
            continue

    if operator == '+':
        stack.append(num)
    elif operator == '-':
        stack.append(-num)
    elif operator == '*':
        stack[-1] = stack[-1] * num
    elif operator == '/':
        stack[-1] = int(stack[-1] / num)

    return sum(stack)
